import React from 'react';
import { HomeMenu } from '../../mockData/data';
import {FaSearch} from 'react-icons/fa';
import { FaBell } from "react-icons/fa6";
import { IoMdMenu } from "react-icons/io";
import { AiOutlineShoppingCart } from "react-icons/ai";




export function Home() {
  return (
    <>
    <home >
        <div className='container flex justify-between items-center py-8'>
            <div className='text-2xl flex items-center gap-2 font-bold uppercase'>
                <FaBell/>
                <p>Compliance</p>
                <p className='text-secondary'>App</p>
            </div>
            <div className='hidden md:block'>
                <ul className='flex items-center gap-6 text-gray-600'>
                    {HomeMenu.map((item)=>{
                            return(
                                <li key={item.id}>
                                    <a href={item.link} className='inline-block py-1 px-3 hover:text-primary font-semibold'>{item.title}</a>
                                </li>
                            )
                        })
                    }
                </ul>
            </div>

            <div className='flex items-center gap-4'>
                <button className='text-2xl hover:bg-primary hover:text-white rounded-full p-2 duration-200'>
                    <FaSearch/>
                </button>
                                <button className='text-2xl hover:bg-primary hover:text-white rounded-full p-2 duration-200'>
                    <AiOutlineShoppingCart/>
                </button>

                <button 
                className='hover:bg-primary text-primary
                 font-semibold hover:text-white 
                 border-2 border-primary 
                 rounded-md border-primary px-6 py-2 
                 duration-200 hidden md:block'>Login</button>

                 <button 
                className='hover:bg-primary text-primary
                 font-semibold hover:font-bold hover:shadow-md
 
                 border-2 border-primary 
                 rounded-md border-primary px-6 py-2 
                 duration-200 hidden md:block'>SignUp</button>


            </div>

        </div>
    </home>
    </>
  );
}
